import React, { Component } from 'react';


class Nav extends Component{
    render(){
        return(
            <div className='marco container'>
                <style jsx>
                    {`
                        .marco{
                            background: #000;
                        }
                    `}
                </style>
            </div>
        );
    }
}

export default Nav;
